// src/pages/Reports.jsx
import React from "react";
import Chart from "../components/Chart";

const Reports = () => {
  const data = [
    { label: "Website Design", value: 150 },
    { label: "React App", value: 200 },
  ];

  return (
    <div className="reports-page">
      <h1>Reports</h1>
      <Chart data={data} />
    </div>
  );
};

export default Reports;
